const items = $input.all();
const updatedItems = items.map((item) => {
  let content = item?.json?.content;
  for (const key in item?.json?.data) {
    content = content.replace(
      new RegExp(`<${key}>`, "g"),
      item?.json?.data[key],
    );
  }
  return { content };
});
return updatedItems;
